import React, {useEffect} from 'react';
import getOrders from '../../../store/orders/middleware';

const Orders = () => {
  useEffect(() => {
    const ordersToRender = async () => {
      const results = getOrders();
      console.log(results);
    }
    ordersToRender()
  }, [])
  console.log('Hello');
  return (
    <div>
      <p>
        This is orders
      </p>
    </div>
  );
}

export default Orders;
